import React from 'react'
import { HeroContainer,HeroBg,VideoBg,HeroContent,HeroH1 } from './HeroComponents';
import Video from '../../videos/video.mp4'
 const Hero = () => {
  return (
    <>
    <HeroContainer>
    <HeroBg>
        <VideoBg autoPlay loop muted src = {Video} type = 'video/mp4' /> 
    </HeroBg>
    <HeroContent>
        <HeroH1>LIVE MUSIC</HeroH1>
        {/* <HeroH2>EVENTS EVERY DAY</HeroH2> */}
    </HeroContent>
    </HeroContainer>
    </>
  );
};
export default Hero;
